import './App.css';
import React from 'react';
import { Container, Row, Col, Table, Navbar } from 'reactstrap';
import Tabler from './components/Table';
import Nav_bar from './components/Nav_bar';
import Table_View from './components/Table_View';
import Firmware_Version from './components/Firmware_Version';
// import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      datavalue: 1
    }
    this.number = 2
  }
  // examHandle() {
  //   console.log(this.number, this.state)
  //   this.setState({
  //     datavalue: this.state.datavalue + 1
  //   })
  // }
  render() {
    // console.log('hello world')
    return (
      <div>
        {
          <div>
            <Nav_bar></Nav_bar>
            <div>
              <nav aria-label="breadcrumb">
                <ol class="breadcrumb">
                  <li class="breadcrumb-item active" aria-current="page"></li>
                </ol>
              </nav>
            </div>

            <div class="container-fluid">
              <div class="row">
                <div class="col">
                  <div>
                    <Table_View></Table_View>
                  </div>
                </div>
                <div class="col">
                  <Firmware_Version></Firmware_Version>
                </div>
                <div class="col">
                  <div class="d-grid gap-2 d-md-flex justify-content-md-end">
                    <button type="button" class="btn btn-danger">
                      Refresh Page
                    </button>
                  </div>
                </div>
              </div>

              <div class="row">
                <div class="col">
                  <div>
                    <nav aria-label="breadcrumb">
                      <ol class="breadcrumb">
                        <li class="breadcrumb-item active" aria-current="page"></li>
                      </ol>
                    </nav>
                  </div>
                </div>
                <div class="col">
                  {/* Column2 Row2 */}
                </div>
              </div>
              <div class="row">
                <div class="col-7">
                  <Tabler></Tabler>
                </div>
                <div class="col-5">
                  <div class="card text-white border-danger bg-dark mb-3">
                    <div class="card-header text-center">
                      Output
                    </div>
                    <div class="card-body">
                      <textarea rows={10} cols={76}>
                        Complete
                      </textarea>
                      <div class="d-grid gap-2 d-md-flex justify-content-md-center">
                        <button type="button" class="btn btn-success">
                          Confirm
                        </button>
                        <button type="button" class="btn btn-primary">
                          Repeat
                        </button>
                        <button type="button" class="btn btn-danger">
                          Cancel
                        </button>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        }
      </div>
    );
  }

}
export default App;
